|In France, since 2006, the law on copyright and related rights in the information society (known as DADVSI) extended the scope of legal deposit to "signs, signals, writings, images, sounds or messages of any kind " communicated to the public by electronic means - in other words legal deposit of the web. Archiving the French web is a legal commitment, which continues the heritage mission of the BnF. As it is technically impossible to permanently collect all Web content, the goal of completeness from the legal deposit of printed documents has evolved into a sampling approach to create digital collections that show the production and the behaviour of French internet users. |}
